  [],\n\t\"revision_timestamp\": \"2016-07-27T22:40:22.778249\",\n\t\"name\": \"clarence-cannon-national-wildlife-refuge-mark-twain-national-wildlife-refuge-annual-narr-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Clarence
  Cannon NWR outlines Refuge accomplishments during the 1987 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning
  and compliance with environmental and cultural resource mandates. Refuge administration
  is outlined; information about personnel, youth programs, volunteer programs, funding,
  and safety is given. Habitat management is also covered; subjects include wetlands,
  croplands, fire management, and pest control. The wildlife section of the report
  discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, and disease control. The public uses of the Refuge
  described in this report include interpretive programs and law enforcement. The
  equipment and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, communication systems,
  computer systems, and energy conservation.\",\n\t\"license_title\": \"License Not
